import React, { useState } from 'react';
import './FoodDisplay.css';
import pizza from './pizza.jpeg';
import burger from './burger.jpeg';
import pasta from './pasta.jpeg';
import salad from './salad.jpeg';
import steak from './steak.jpeg';
import tacos from './tacos.jpeg';
import smoothie from './smoothie.jpeg';
import iceCream from './icecream.jpeg';
import axios from 'axios';

const foodData = [
  { id: 1, name: 'Pizza', price: 10, imageUrl: pizza, section: 'Veg' },
  { id: 2, name: 'Pasta', price: 12, imageUrl: pasta, section: 'Veg' },
  { id: 3, name: 'Veggie Burger', price: 6, imageUrl: burger, section: 'Veg' },
  { id: 4, name: 'Chicken Burger', price: 8, imageUrl: burger, section: 'Non-Veg' },
  { id: 5, name: 'Steak', price: 20, imageUrl: steak, section: 'Non-Veg' },
  { id: 6, name: 'Shrimp Tacos', price: 15, imageUrl: tacos, section: 'Non-Veg' },
  { id: 7, name: 'Ice Cream Sundae', price: 7, imageUrl: iceCream, section: 'Desserts' },
  { id: 8, name: 'Smoothie', price: 5, imageUrl: smoothie, section: 'Beverages' },
];

const FoodDisplay = () => {
  const [cartItems, setCartItems] = useState([]);
  const [showPaymentPage, setShowPaymentPage] = useState(false); // For toggling pages

  const handleAddToCart = (food) => {
    setCartItems([...cartItems, food]);
  };

  // Function to handle checkout (shows payment page)
  const handleCheckout = () => {
    if (cartItems.length > 0) {
      setShowPaymentPage(true); // Toggle to show the payment page
    } else {
      alert('Your cart is empty.');
    }
  };

  // Calculate total amount from the cart
  const totalAmount = cartItems.reduce((total, item) => total + item.price, 0);

  // Payment Page Component
  const PaymentPage = () => {
    return (
      <div className="payment-page">
        <h1>Payment Page</h1>
        <h2>Your Order</h2>
        <ul>
          {cartItems.map((item, index) => (
            <li key={index}>
              {item.name} - ${item.price.toFixed(2)}
            </li>
          ))}
        </ul>
        <h3>Total: ${totalAmount.toFixed(2)}</h3>
        <button onClick={() => alert("Payment Successful")}>Proceed to Payment</button>
      </div>
    );
  };

  return (
    <div className="food-display-container">
      {!showPaymentPage ? (
        <>
          <h1>Food Menu</h1>
          <div className="food-list">
            {foodData.map((food) => (
              <div key={food.id} className="food-item">
                <h3>{food.name}</h3>
                <p>Price: ${food.price.toFixed(2)}</p>
                <button onClick={() => handleAddToCart(food)} className="add-to-cart-btn">
                  Add to Cart
                </button>
              </div>
            ))}
          </div>

          <div className="cart">
            <h2>Your Cart</h2>
            <ul className="cart-list">
              {cartItems.map((item, index) => (
                <li key={index} className="cart-item">
                  {item.name} - ${item.price.toFixed(2)}
                </li>
              ))}
            </ul>
            <h3>Total: ${totalAmount.toFixed(2)}</h3>
            <button onClick={handleCheckout} disabled={cartItems.length === 0} className="checkout-btn">
              Checkout
            </button>
          </div>
        </>
      ) : (
        // Show PaymentPage when checkout is clicked
        <PaymentPage />
      )}
    </div>
  );
};

export default FoodDisplay;
